import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Rental() {
  const [rentals, setRentals] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/rentals/')
      .then((response) => {
        setRentals(response.data);
      })
      .catch((error) => {
        console.error('Error fetching rental data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Rental Listings</h1>
      {rentals.map((rental) => (
        <div key={rental.id} className="rental-item">
          <h3>Vehicle Type: {rental.vehicle_type}</h3>
          <p>Phone Number: {rental.phone_number}</p>
          <p>Model: {rental.model}</p>
          <p>Description: {rental.description}</p>
          <p>Is Available: {rental.is_available ? 'Yes' : 'No'}</p>
          <img src={rental.image} alt="Vehicle" width="200" />
          {/* You can add more fields here as needed */}
        </div>
      ))}
    </div>
  );
}

export default Rental;
